import React from "react";


const TieredPricing = () => {
    let valueX = 1
  return (
    <TieredPricing>
      <div className="table-responsive" id="sailorTableArea">
        <table
          id="sailorTable"
          className="table table-striped table-bordered"
          width="100%"
        >
          <thead>
            <tr>
              <th>Quantity</th>
              <th>Discount</th>
              <th>Price per unit</th>

            </tr>
          </thead>
          <tbody>
            <tr className="bg-primary text-white">
              <td>4-9</td>
              <td>---</td>
              <td>$20.00</td>

            </tr>
            <tr>
              <td>10-14</td>
              <td>15%</td>
              <td>$18.00</td>

            </tr>
            <tr>
              <td>15+</td>
              <td>20%</td>
              <td>$15.00</td>
            </tr>

          </tbody>
        </table>
      </div>
      <style jsx>{`
       #sailorTableArea {
        max-height: 300px;
        overflow-x: auto;
        overflow-y: auto;
      }
      #sailorTable {
        white-space: normal;
      }
      tbody {
        display: block;
        height: 200px;
        overflow: auto;
      }
      thead,
      tbody tr {
        display: table;
        width: 100%;
        table-layout: fixed;
      }
      `}</style>
    </TieredPricing>
  );
};

export default TieredPricing;
